import axios from 'axios';

export const fetchPlayerList = () => {

    return async (dispatch) => {
        const response = await axios.get('https://api.scoutium.com/api/clubs/4029/players?count=100');

        dispatch({
            type: 'FETCH_PLAYER_LIST',
            payload: response.data
        })
    }
}
